// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awHeaderPropertiesRenderFn } from 'js/AwHeaderPropertiesService';


/*
ctx imports
*/
import { getApplicableViews as contributedHeaders } from 'js/AwHeaderPropertiesService';
const ctxImportObj = { contributedHeaders };


/*
dynamic import
 */
registerDynImportEntry('js/AwHeaderPropertiesService', () => import('js/AwHeaderPropertiesService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awHeaderPropertiesRenderFn",
            "deps": "js/AwHeaderPropertiesService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "ctx": {
        "contributedHeaders": {
            "parser": {
                "method": "getApplicableViews",
                "deps": "js/AwHeaderPropertiesService"
            }
        }
    },
    "_viewModelId": "AwHeaderProperties",
    "_uniqueViewModelId": "AwHeaderProperties"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awHeaderPropertiesRenderFn, undefined, ctxImportObj );

export default Component;
